import React, { useEffect, useState } from "react";
import axios from "axios";

const Row = () => {
  let [data, setData] = useState([]);

  useEffect(() => {
    const getcampaignlist = async () => {
      await axios({
        method: "get",
        url: "http://localhost:8000/"
      }).then(
        response => {
          setData(response.data.data[0]);
        },
        error => {
          console.error(error);
        }
      );
    };
    getcampaignlist();
  }, []);
  return (
    <>
      <td>{data.createdOn}</td>
      <td>{data.name}</td>
      <td>{data.price}</td>
    </>
  );
};

export default Row;
